            logger.debug("MOVE '&&' TO WSS-MSG-PTC0");

            wssErrVari.getWssMsgPtc().setWssMsgPtc0("&&");

            logger.debug("wssErrVari.getWssMsgPtc().getWssMsgPtc0() :" + wssErrVari.getWssMsgPtc().getWssMsgPtc0());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //wssErrVari.getWssSepNfrm().setValue("       ");
            //mnu.setMnuGlsNfrm("       ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE MNU-GLS-NFRM TO WSS-SEP-NFRM");

            wssErrVari.getWssSepNfrm().setValue(mnu.getMnuGlsNfrm());

            logger.debug("wssErrVari.getWssSepNfrm().getValue() :" + wssErrVari.getWssSepNfrm().getValue());
            logger.debug("mnu.getMnuGlsNfrm() :" + mnu.getMnuGlsNfrm());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //wssErrVari.getWssMsgPtc().setWssMsgPtc1("   ");
            //wssErrVari.getWssSepNfrm().setWssSepNfrm2("   ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE WSS-SEP-NFRM2 TO WSS-MSG-PTC1");

            wssErrVari.getWssMsgPtc().setWssMsgPtc1(wssErrVari.getWssSepNfrm().getWssSepNfrm2());

            logger.debug("wssErrVari.getWssMsgPtc().getWssMsgPtc1() :" + wssErrVari.getWssMsgPtc().getWssMsgPtc1());
            logger.debug("wssErrVari.getWssSepNfrm().getWssSepNfrm2() :" + wssErrVari.getWssSepNfrm().getWssSepNfrm2());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //wssErrVari.getWssMsgPtc().setWssMsgPtc3("    ");
            //wssErrVari.setWssNumErrPtc(0);
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE WSS-NUM-ERR-PTC TO WSS-MSG-PTC3");

            wssErrVari.getWssMsgPtc().setWssMsgPtc3(Util.intToString(wssErrVari.getWssNumErrPtc(), 4));

