        //tdi.setTdiNumReco(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE TDI-NUM-RECO IN TDI TO QUE-NITM");

        queVari.setQueNitm(tdi.getTdiNumReco());

