                        //queCtts.setQueMod("   ");
                        //////////////////////////////////////////////////////////////////////////////////////////////
                        logger.debug("MOVE QUE-MOD TO QUE-CMND");

                        queVari.setQueCmnd(queCtts.getQueMod());

