        logger.debug("entrando a 'gnsFioMnu_iniGnsFioMnu()' ...");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //adrReqa.setValue("                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              ");
        //adrMnuReqa.setValue("                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              ");
