    /******************************************************************************
     * msgFromSrv_iniMsgFromSrv
     ******************************************************************************/
    /**
     *
     * TODO_javadoc.
     *
     * @return TODO_javadoc.
     *
     */
    public String msgFromSrv_iniMsgFromSrv() {

        logger.debug("entrando a 'msgFromSrv_iniMsgFromSrv()' ...");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssBtdi(0);
        //wssVari.setWssIdxFrmSrv(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("ADD 21 WSS-BTDI GIVING WSS-IDX-FRM-SRV");

        wssVari.setWssIdxFrmSrv(21 + wssVari.getWssBtdi());

        logger.debug("wssVari.getWssBtdi() :" + wssVari.getWssBtdi());
        logger.debug("wssVari.getWssIdxFrmSrv() :" + wssVari.getWssIdxFrmSrv());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssLtdi(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE 21 TO WSS-LTDI");

        wssVari.setWssLtdi(21);

        logger.debug("wssVari.getWssLtdi() :" + wssVari.getWssLtdi());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssCtdi(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE ZEROES TO WSS-CTDI");

        wssVari.setWssCtdi(0);

        logger.debug("wssVari.getWssCtdi() :" + wssVari.getWssCtdi());

        wssVari.setWssItdi(wssVari.getWssBtdi());

        do {

            execute("movHdrSrv");

            wssVari.setWssItdi(wssVari.getWssItdi() + 1);

            if (wssVari.getWssCtdi() == wssVari.getWssLtdi()) {
                break;
            }

        } while (true);

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssBtdi(0);
        //wssVari.setWssItdi(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE WSS-ITDI TO WSS-BTDI");

        wssVari.setWssBtdi(wssVari.getWssItdi());

        logger.debug("wssVari.getWssBtdi() :" + wssVari.getWssBtdi());
        logger.debug("wssVari.getWssItdi() :" + wssVari.getWssItdi());

        execute("tdiToTsc");

        execute("getMnu");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssMnuGlsNfrm("       ");
        //mnu.setMnuGlsNfrm("       ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE MNU-GLS-NFRM IN MNU TO WSS-MNU-GLS-NFRM");

        wssVari.setWssMnuGlsNfrm(mnu.getMnuGlsNfrm());

        logger.debug("wssVari.getWssMnuGlsNfrm() :" + wssVari.getWssMnuGlsNfrm());
        logger.debug("mnu.getMnuGlsNfrm() :" + mnu.getMnuGlsNfrm());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssIdxSrv(0);
        //wssVari.setWssIdxSrv(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("ADD 1 TO WSS-IDX-SRV");

        wssVari.setWssIdxSrv(1 + wssVari.getWssIdxSrv());

        logger.debug("wssVari.getWssIdxSrv() :" + wssVari.getWssIdxSrv());
        logger.debug("wssVari.getWssIdxSrv() :" + wssVari.getWssIdxSrv());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssIdxSrv(0);
        //wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).setWssSrvSist("   ");
        //tdiFrm.getTdiHdrFrm().setTdiCodSistFrm("   ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE TDI-COD-SIST-FRM TO WSS-SRV-SIST( WSS-IDX-SRV)");

        wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).setWssSrvSist(tdiFrm.getTdiHdrFrm().getTdiCodSistFrm());

        logger.debug("wssVari.getWssIdxSrv() :" + wssVari.getWssIdxSrv());
        logger.debug("wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).getWssSrvSist() :" + wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).getWssSrvSist());
        logger.debug("tdiFrm.getTdiHdrFrm().getTdiCodSistFrm() :" + tdiFrm.getTdiHdrFrm().getTdiCodSistFrm());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssIdxSrv(0);
        //wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).setWssSrvFout("   ");
        //tdiFrm.getTdiHdrFrm().setTdiCodFoutFrm("   ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE TDI-COD-FOUT-FRM TO WSS-SRV-FOUT( WSS-IDX-SRV)");

        wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).setWssSrvFout(tdiFrm.getTdiHdrFrm().getTdiCodFoutFrm());

        logger.debug("wssVari.getWssIdxSrv() :" + wssVari.getWssIdxSrv());
        logger.debug("wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).getWssSrvFout() :" + wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).getWssSrvFout());
        logger.debug("tdiFrm.getTdiHdrFrm().getTdiCodFoutFrm() :" + tdiFrm.getTdiHdrFrm().getTdiCodFoutFrm());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssIdxSrv(0);
        //wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).setWssSrvNfrm("       ");
        //mnu.setMnuGlsNfrm("       ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE MNU-GLS-NFRM IN MNU TO WSS-SRV-NFRM( WSS-IDX-SRV)");

        wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).setWssSrvNfrm(mnu.getMnuGlsNfrm());

        logger.debug("wssVari.getWssIdxSrv() :" + wssVari.getWssIdxSrv());
        logger.debug("wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).getWssSrvNfrm() :" + wssVari.getWssSrvVari(wssVari.getWssIdxSrv() - 1).getWssSrvNfrm());
        logger.debug("mnu.getMnuGlsNfrm() :" + mnu.getMnuGlsNfrm());

        execute("getTsi");

        if (fioVari.getFioStat().isFioStatOks()) {

            if (!mnu.getMnuGlsNfrm().equals(tsi.getTsiData().getTsiGlsFrmHst().getTsiGlsNfrm()) || mnu.getMnuCodInst().equals("GKY")) {

                execute("delTsi");

                //// setters /////////////////////////////////////////////////////////////////////////////////
                //tsi.getTsiData().setValue("                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                           ");
                //////////////////////////////////////////////////////////////////////////////////////////////
                logger.debug("MOVE SPACES TO TSI-DATA");

                tsi.getTsiData().setValue(Util.spaces(2011));

                logger.debug("tsi.getTsiData().getValue() :" + tsi.getTsiData().getValue());

                //// setters /////////////////////////////////////////////////////////////////////////////////
                //pgmStat.setPgmStatTsi("  ");
                //////////////////////////////////////////////////////////////////////////////////////////////
                logger.debug("MOVE '23' TO PGM-STAT-TSI");

                pgmStat.setPgmStatTsi("23");

                logger.debug("pgmStat.getPgmStatTsi() :" + pgmStat.getPgmStatTsi());
            }
            else {

                //// setters /////////////////////////////////////////////////////////////////////////////////
                //pgmStat.setPgmStatTsi("  ");
                //////////////////////////////////////////////////////////////////////////////////////////////
                logger.debug("MOVE '00' TO PGM-STAT-TSI");

                pgmStat.setPgmStatTsi("00");

                logger.debug("pgmStat.getPgmStatTsi() :" + pgmStat.getPgmStatTsi());
            }
        }
        else {

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //pgmStat.setPgmStatTsi("  ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE '23' TO PGM-STAT-TSI");

            pgmStat.setPgmStatTsi("23");

            logger.debug("pgmStat.getPgmStatTsi() :" + pgmStat.getPgmStatTsi());
        }

        execute("mnuToTsc");

        execute("getRpf");

        if (tscVari.getTscItem().getTscI() > 0) {

            execute("rpfToTsc");
        }

        if ((tscVari.getTscItem().getTscTinf().getTscTinv().equals("C")) || (tscVari.getTscItem().getTscTinf().getValue().compareTo(Util.spaces(3)) <= 0)) {

            execute("proMoveScr1");
        }
        else {

            execute("proMoveScr2");
        }

        execute("proMoveVsys");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //fioVari.getFioVoid().setFioSist("   ");
        //tdiFrm.getTdiHdrFrm().setTdiCodSistFrm("   ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE TDI-COD-SIST-FRM TO FIO-SIST");

        fioVari.getFioVoid().setFioSist(tdiFrm.getTdiHdrFrm().getTdiCodSistFrm());

        logger.debug("fioVari.getFioVoid().getFioSist() :" + fioVari.getFioVoid().getFioSist());
        logger.debug("tdiFrm.getTdiHdrFrm().getTdiCodSistFrm() :" + tdiFrm.getTdiHdrFrm().getTdiCodSistFrm());

        execute("getDefSrv");

        execute("getDefHst");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssIdxFldSrv(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE 1 TO WSS-IDX-FLD-SRV");

        wssVari.setWssIdxFldSrv(1);

        logger.debug("wssVari.getWssIdxFldSrv() :" + wssVari.getWssIdxFldSrv());

        wssVari.setWssIdxFldHst(1);

        do {

            execute("putInfToHst");

            wssVari.setWssIdxFldHst(wssVari.getWssIdxFldHst() + 1);

            if (wssVari.getWssIdxFldHst() > wssVari.getWssTotFldHst()) {
                break;
            }

        } while (true);

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssTotFldHst(0);
        //wssVari.getWssGlsPosHst().setWssNumPosHst(wssVari.getWssTotFldHst() - 1, 0);
        //wssVari.setWssPini(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("ADD 15 WSS-NUM-POS-HST( WSS-TOT-FLD-HST) GIVING WSS-PINI");

        wssVari.setWssPini(15 + wssVari.getWssGlsPosHst().getWssNumPosHst(wssVari.getWssTotFldHst() - 1));

        logger.debug("wssVari.getWssTotFldHst() :" + wssVari.getWssTotFldHst());
        logger.debug("wssVari.getWssGlsPosHst().getWssNumPosHst(wssVari.getWssTotFldHst() - 1) :" + wssVari.getWssGlsPosHst().getWssNumPosHst(wssVari.getWssTotFldHst() - 1));
        logger.debug("wssVari.getWssPini() :" + wssVari.getWssPini());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssTotFldHst(0);
        //wssVari.getWssGlsLenHst().setWssNumLenHst(wssVari.getWssTotFldHst() - 1, 0);
        //wssVari.setWssPini(0);
        //wssVari.setWssPini(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("ADD WSS-NUM-LEN-HST( WSS-TOT-FLD-HST) TO WSS-PINI");

        wssVari.setWssPini(wssVari.getWssGlsLenHst().getWssNumLenHst(wssVari.getWssTotFldHst() - 1) + wssVari.getWssPini());

        logger.debug("wssVari.getWssTotFldHst() :" + wssVari.getWssTotFldHst());
        logger.debug("wssVari.getWssGlsLenHst().getWssNumLenHst(wssVari.getWssTotFldHst() - 1) :" + wssVari.getWssGlsLenHst().getWssNumLenHst(wssVari.getWssTotFldHst() - 1));
        logger.debug("wssVari.getWssPini() :" + wssVari.getWssPini());
        logger.debug("wssVari.getWssPini() :" + wssVari.getWssPini());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssPini(0);
        //tsi.getTsiData().getTsiGlsFrmHst().setTsiCodFrmHst(wssVari.getWssPini() - 1, "                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE ' ' TO TSI-COD-FRM-HST( WSS-PINI)");

        tsi.getTsiData().getTsiGlsFrmHst().setTsiCodFrmHst(wssVari.getWssPini() - 1, " ");

        logger.debug("wssVari.getWssPini() :" + wssVari.getWssPini());
        logger.debug("tsi.getTsiData().getTsiGlsFrmHst().getTsiCodFrmHst(wssVari.getWssPini() - 1) :" + tsi.getTsiData().getTsiGlsFrmHst().getTsiCodFrmHst(wssVari.getWssPini() - 1));

        if (!pgmStat.isPgmStatTsiOks()) {

            execute("putTsi");
        }
        else {

            execute("modTsi");
        }

        execute("proCallLink");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssBtdi(0);
        //wssVari.setWssIdxFrmSrv(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE WSS-IDX-FRM-SRV TO WSS-BTDI");

        wssVari.setWssBtdi(wssVari.getWssIdxFrmSrv());

        logger.debug("wssVari.getWssBtdi() :" + wssVari.getWssBtdi());
        logger.debug("wssVari.getWssIdxFrmSrv() :" + wssVari.getWssIdxFrmSrv());

        logger.debug("saliendo de 'msgFromSrv_iniMsgFromSrv()' ...");

        return "msgFromSrv_finMsgFromSrv";
    }

