        logger.debug("tscVari.getTscItem().getTscI() :" + tscVari.getTscItem().getTscI());
        logger.debug("tscVari.getTscItem().getTscCrpf().getTscTabl(tscVari.getTscItem().getTscI() - 1).getTscCcpp() :" + tscVari.getTscItem().getTscCrpf().getTscTabl(tscVari.getTscItem().getTscI() - 1).getTscCcpp());
