        logger.debug("tscVari.getTscItem().getTscI() :" + tscVari.getTscItem().getTscI());
        logger.debug("tscVari.getTscItem().getTscCrpf().getTscTabl(tscVari.getTscItem().getTscI() - 1).getTscStpp() :" + tscVari.getTscItem().getTscCrpf().getTscTabl(tscVari.getTscItem().getTscI() - 1).getTscStpp());
        logger.debug("rpf.getRpfGlsDat4().getRpfIndStpp() :" + rpf.getRpfGlsDat4().getRpfIndStpp());

