        logger.debug("wssVari.getWssGlsLenHst().getWssNumLenHst(wssVari.getWssIdxFldHst() - 1) :" + wssVari.getWssGlsLenHst().getWssNumLenHst(wssVari.getWssIdxFldHst() - 1));
