        wssVari.getWssGlsPosHst().setWssNumPosHst(wssVari.getWssIdxFldHst() - 1, tsiIdxFrmHst);

        logger.debug("wssVari.getWssIdxFldHst() :" + wssVari.getWssIdxFldHst());
        logger.debug("wssVari.getWssGlsPosHst().getWssNumPosHst(wssVari.getWssIdxFldHst() - 1) :" + wssVari.getWssGlsPosHst().getWssNumPosHst(wssVari.getWssIdxFldHst() - 1));
