        logger.debug("wssVari.getWssNum99() :" + wssVari.getWssNum99());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssBtsi(0);
        //tsi.getTsiData().getTsiGlsFrmHst().setTsiCodFrmHst(wssVari.getWssBtsi() - 1, "                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    ");
        //wssVari.getWssNumXx().setWssNumXx1(" ");
        //////////////////////////////////////////////////////////////////////////////////////////////
