        logger.debug("wssVari.getWssNumXx().getWssNumXx1() :" + wssVari.getWssNumXx().getWssNumXx1());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //wssVari.setWssBtsi(0);
