    /******************************************************************************
     * fin_iniFin
     ******************************************************************************/
    /**
     *
     * TODO_javadoc.
     *
     * @return TODO_javadoc.
     *
     */
    public String fin_iniFin() {

        logger.debug("entrando a 'fin_iniFin()' ...");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //queVari.getQueCola().setValue("        ");
        //wssIddVari.getWssQidd().setValue("        ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE WSS-QIDD TO QUE-COLA");

        queVari.getQueCola().setValue(wssIddVari.getWssQidd().getValue());

        logger.debug("queVari.getQueCola().getValue() :" + queVari.getQueCola().getValue());
        logger.debug("wssIddVari.getWssQidd().getValue() :" + wssIddVari.getWssQidd().getValue());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //queVari.setQueCmnd("   ");
        //queCtts.setQueDel("   ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE QUE-DEL TO QUE-CMND");

        queVari.setQueCmnd(queCtts.getQueDel());

        logger.debug("queVari.getQueCmnd() :" + queVari.getQueCmnd());
        logger.debug("queCtts.getQueDel() :" + queCtts.getQueDel());

        execute("gnsProQue");

        if (ptcWssBckiQue.equals("S")) {

            execute("bckOut");
        }

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //queVari.getQueCola().setQueTerm("    ");
        //tskVari.setTskTermAlf("    ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE TSK-TERM-ALF TO QUE-TERM");

        queVari.getQueCola().setQueTerm(tskVari.getTskTermAlf());

        logger.debug("queVari.getQueCola().getQueTerm() :" + queVari.getQueCola().getQueTerm());
        logger.debug("tskVari.getTskTermAlf() :" + tskVari.getTskTermAlf());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //queVari.getQueCola().setQueType("    ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE 'CTM ' TO QUE-TYPE");

        queVari.getQueCola().setQueType("CTM ");

        logger.debug("queVari.getQueCola().getQueType() :" + queVari.getQueCola().getQueType());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //queVari.setQueLitm(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE + 18 TO QUE-LITM");

        queVari.setQueLitm(+18);

        logger.debug("queVari.getQueLitm() :" + queVari.getQueLitm());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //queVari.setQueNitm(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE 1 TO QUE-NITM");

        queVari.setQueNitm(1);

        logger.debug("queVari.getQueNitm() :" + queVari.getQueNitm());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //queVari.setQueCmnd("   ");
        //queCtts.setQueGet("   ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE QUE-GET TO QUE-CMND");

        queVari.setQueCmnd(queCtts.getQueGet());

        logger.debug("queVari.getQueCmnd() :" + queVari.getQueCmnd());
        logger.debug("queCtts.getQueGet() :" + queCtts.getQueGet());

        execute("gnsProQue");

        if (queVari.getQueStat().equals(queVari.getQueStatOks())) {

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //sysVari.setSysTcma(0);
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE 0 TO SYS-TCMA");

            sysVari.setSysTcma(0);

            logger.debug("sysVari.getSysTcma() :" + sysVari.getSysTcma());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //sysVari.getSysCmma().setValue("                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE SPACES TO SYS-CMMA");

            sysVari.getSysCmma().setValue(Util.spaces(3504));

            logger.debug("sysVari.getSysCmma().getValue() :" + sysVari.getSysCmma().getValue());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //sysVari.setSysCmnd(0);
            //sysCtts.setSysXctl(0);
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE SYS-XCTL TO SYS-CMND");

            sysVari.setSysCmnd(sysCtts.getSysXctl());

            logger.debug("sysVari.getSysCmnd() :" + sysVari.getSysCmnd());
            logger.debug("sysCtts.getSysXctl() :" + sysCtts.getSysXctl());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //sysVari.setSysProg("        ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE 'LDCPPTRO' TO SYS-PROG");

            sysVari.setSysProg("LDCPPTRO");

            logger.debug("sysVari.getSysProg() :" + sysVari.getSysProg());

            execute("gnsProSys");
        }
        else {

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //logmsg.getLogmsgText().setValue("                                                  ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE 'TPRETURN ' TO LOGMSG-TEXT");

            logmsg.getLogmsgText().setValue("TPRETURN ");

            logger.debug("logmsg.getLogmsgText().getValue() :" + logmsg.getLogmsgText().getValue());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //logmsg.setLogmsgNumb("  ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE '01' TO LOGMSG-NUMB");

            logmsg.setLogmsgNumb("01");

            logger.debug("logmsg.getLogmsgNumb() :" + logmsg.getLogmsgNumb());

            execute("doUserlog");

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //tptypeRec.setLen(0);
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE LENGTH OF DFHCOMMAREA TO LEN");

            tptypeRec.setLen(dfhcommarea.getValue().length());

            logger.debug("tptypeRec.getLen() :" + tptypeRec.getLen());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //tpsvcretRec.setTpsuccess(0);
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("SET TPSUCCESS TO TRUE");

            tpsvcretRec.setTpsuccess(true);

            logger.debug("tpsvcretRec.isTpsuccess() :" + tpsvcretRec.isTpsuccess());
        }
        logger.debug("CALL \"TPRETURN\" USING TPSVCRET-REC TPTYPE-REC DFHCOMMAREA TPSTATUS-REC");

        System.exit(returnCode);

        logger.debug("saliendo de 'fin_iniFin()' ...");

        return null;
    }

