    public String busRciIdd_cicBusRciIdd() {

        logger.debug("entrando a 'busRciIdd_cicBusRciIdd()' ...");

        execute("gnsFioRci");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //rciVari.getRciKeyCpto().setRciCodCpto("            ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("DISPLAY 'RCI 1 <' RCI-COD-CPTO IN RCI-VARI '>'");

        logger.info("RCI 1 <" + rciVari.getRciKeyCpto().getRciCodCpto() + ">");

        logger.debug("rciVari.getRciKeyCpto().getRciCodCpto() :" + rciVari.getRciKeyCpto().getRciCodCpto());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //rci.getRciKeyIrci().getRciKeyCpto().setRciCodCpto("            ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("DISPLAY 'RCI 2 <' RCI-COD-CPTO IN RCI '>'");

        logger.info("RCI 2 <" + rci.getRciKeyIrci().getRciKeyCpto().getRciCodCpto() + ">");

        logger.debug("rci.getRciKeyIrci().getRciKeyCpto().getRciCodCpto() :" + rci.getRciKeyIrci().getRciKeyCpto().getRciCodCpto());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //rciVari.getRciKeyCpto().getRciGlsAmbt().setValue("                                                      ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("DISPLAY 'RCI 3 <' RCI-GLS-AMBT IN RCI-VARI '>'");

        logger.info("RCI 3 <" + rciVari.getRciKeyCpto().getRciGlsAmbt().getValue() + ">");

        logger.debug("rciVari.getRciKeyCpto().getRciGlsAmbt().getValue() :" + rciVari.getRciKeyCpto().getRciGlsAmbt().getValue());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //rci.getRciKeyIrci().getRciKeyCpto().getRciGlsAmbt().setValue("                                                      ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("DISPLAY 'RCI 4 <' RCI-GLS-AMBT IN RCI '>'");

        logger.info("RCI 4 <" + rci.getRciKeyIrci().getRciKeyCpto().getRciGlsAmbt().getValue() + ">");

        logger.debug("rci.getRciKeyIrci().getRciKeyCpto().getRciGlsAmbt().getValue() :" + rci.getRciKeyIrci().getRciKeyCpto().getRciGlsAmbt().getValue());

        if (fioVari.getFioStat().isFioStatOks() && rciVari.getRciKeyCpto().getRciCodCpto().equals(rci.getRciKeyIrci().getRciKeyCpto().getRciCodCpto()) && rciVari.getRciKeyCpto().getRciGlsAmbt().getValue().equals(rci.getRciKeyIrci().getRciKeyCpto().getRciGlsAmbt().getValue())) {
            logger.debug("DISPLAY 'NO ENCONTRE RCI'");

            logger.info("NO ENCONTRE RCI");

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //rciFstRrci = " ";
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE 'N' TO RCI-FST-RRCI");

            rciFstRrci = "N";

            logger.debug("rciFstRrci :" + rciFstRrci);
        }
        else {

            if (rciFstRrci.equals("N")) {
                logger.debug("GO TO EXT-BUS-RCI-IDD");


                logger.debug("saliendo de 'busRciIdd_cicBusRciIdd()' ...");
                return "busRciIdd_extBusRciIdd";
            }
            else {

                if (rciDflRrci.equals("N")) {

                    //// setters /////////////////////////////////////////////////////////////////////////////////
                    //rciVari.getRciKeyCpto().getRciGlsAmbt().setRciCodCnal("     ");
                    //////////////////////////////////////////////////////////////////////////////////////////////
                    logger.debug("MOVE SPACES TO RCI-COD-CNAL IN RCI-VARI");

                    rciVari.getRciKeyCpto().getRciGlsAmbt().setRciCodCnal(Util.spaces(5));

                    logger.debug("rciVari.getRciKeyCpto().getRciGlsAmbt().getRciCodCnal() :" + rciVari.getRciKeyCpto().getRciGlsAmbt().getRciCodCnal());

                    //// setters /////////////////////////////////////////////////////////////////////////////////
                    //rciCnadRrci = "  ";
                    //////////////////////////////////////////////////////////////////////////////////////////////
                    logger.debug("MOVE '-D' TO RCI-CNAD-RRCI");

                    rciCnadRrci = "-D";

                    logger.debug("rciCnadRrci :" + rciCnadRrci);
                    logger.debug("GO TO FST-BUS-RCI-IDD");


                    logger.debug("saliendo de 'busRciIdd_cicBusRciIdd()' ...");
                    return "busRciIdd_fstBusRciIdd";
                }
                else {

                    execute("cargaDefecto");
                    logger.debug("GO TO FIN-BUS-RCI-IDD");


                    logger.debug("saliendo de 'busRciIdd_cicBusRciIdd()' ...");
                    return "busRciIdd_finBusRciIdd";
                }
            }
        }

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //idd.setIddCodCidd("            ");
        //rci.getRciKeyIrci().setRciCodCidd("            ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE RCI-COD-CIDD IN RCI TO IDD-COD-CIDD IN IDD");

        idd.setIddCodCidd(rci.getRciKeyIrci().getRciCodCidd());

        logger.debug("idd.getIddCodCidd() :" + idd.getIddCodCidd());
        logger.debug("rci.getRciKeyIrci().getRciCodCidd() :" + rci.getRciKeyIrci().getRciCodCidd());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //fioVari.setFioCmnd(0);
        //fioCtts.getFioVcmn().setFioGetKey(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE FIO-GET-KEY TO FIO-CMND");

        fioVari.setFioCmnd(fioCtts.getFioVcmn().getFioGetKey());

        logger.debug("fioVari.getFioCmnd() :" + fioVari.getFioCmnd());
        logger.debug("fioCtts.getFioVcmn().getFioGetKey() :" + fioCtts.getFioVcmn().getFioGetKey());

        execute("gnsFioIdd");

        if (!fioVari.getFioStat().isFioStatOks()) {

            execute("cargaDefecto");
            logger.debug("GO TO FIN-BUS-RCI-IDD");


            logger.debug("saliendo de 'busRciIdd_cicBusRciIdd()' ...");
            return "busRciIdd_finBusRciIdd";
        }

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //rciVari.setRciNumInd2(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE 1 TO RCI-NUM-IND2 IN RCI-VARI");

        rciVari.setRciNumInd2(1);

        logger.debug("rciVari.getRciNumInd2() :" + rciVari.getRciNumInd2());

        logger.debug("saliendo de 'busRciIdd_cicBusRciIdd()' ...");

        return "busRciIdd_lupProIdd";
    }

