    /******************************************************************************
     * gnsFioRci_fsrGnsFioRci
     ******************************************************************************/
    /**
     *
     * TODO_javadoc.
     *
     * @return TODO_javadoc.
     *
     */
    public String gnsFioRci_fsrGnsFioRci() {

        logger.debug("entrando a 'gnsFioRci_fsrGnsFioRci()' ...");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //adrElls.setAdrElm1("     ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE 'RCI00' TO ADR-ELM1");

        adrElls.setAdrElm1("RCI00");

        logger.debug("adrElls.getAdrElm1() :" + adrElls.getAdrElm1());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //adrUifb.setAdrProg("        ");
        //fioCtts.setFioProg("        ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE FIO-PROG TO ADR-PROG");

        adrUifb.setAdrProg(fioCtts.getFioProg());

        logger.debug("adrUifb.getAdrProg() :" + adrUifb.getAdrProg());
        logger.debug("fioCtts.getFioProg() :" + fioCtts.getFioProg());

        if (fioCtts.getFioKdef() == fioCtts.getFioKdefS()) {
            logger.debug("GO TO CON-GNS-FIO-RCI");


            logger.debug("saliendo de 'gnsFioRci_fsrGnsFioRci()' ...");
            return "gnsFioRci_conGnsFioRci";
        }

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //fioCtts.setFioIaky(0);
        //fioVari.setFioCmnd(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE FIO-CMND TO FIO-IAKY");

        fioCtts.setFioIaky(fioVari.getFioCmnd());

        logger.debug("fioCtts.getFioIaky() :" + fioCtts.getFioIaky());
        logger.debug("fioVari.getFioCmnd() :" + fioVari.getFioCmnd());

        if (!fioCtts.isFioIakyCon() && (fioVari.getFioAkey().equals("RCI-KEY-IRCI") || fioVari.getFioAkey().compareTo(Util.spaces(32)) <= 0)) {

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //adrReqa.setAdrVkey("                                                                                                                                                                                    ");
            //rci.getRciKeyIrci().setValue("                                                                              ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE RCI-KEY-IRCI IN RCI TO ADR-VKEY IN ADR-REQA");

            adrReqa.setAdrVkey(rci.getRciKeyIrci().getValue());

            logger.debug("adrReqa.getAdrVkey() :" + adrReqa.getAdrVkey());
            logger.debug("rci.getRciKeyIrci().getValue() :" + rci.getRciKeyIrci().getValue());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //adrReqa.setAdrDkey("     ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE 'RCI00' TO ADR-DKEY IN ADR-REQA");

            adrReqa.setAdrDkey("RCI00");

            logger.debug("adrReqa.getAdrDkey() :" + adrReqa.getAdrDkey());
        }
        else {

            if (fioVari.getFioAkey().equals("RCI-COD-CIDD")) {

                //// setters /////////////////////////////////////////////////////////////////////////////////
                //adrReqa.setAdrVkey("                                                                                                                                                                                    ");
                //rci.getRciKeyIrci().setRciCodCidd("            ");
                //////////////////////////////////////////////////////////////////////////////////////////////
                logger.debug("MOVE RCI-COD-CIDD IN RCI TO ADR-VKEY IN ADR-REQA");

                adrReqa.setAdrVkey(rci.getRciKeyIrci().getRciCodCidd());

                logger.debug("adrReqa.getAdrVkey() :" + adrReqa.getAdrVkey());
                logger.debug("rci.getRciKeyIrci().getRciCodCidd() :" + rci.getRciKeyIrci().getRciCodCidd());

                //// setters /////////////////////////////////////////////////////////////////////////////////
                //adrReqa.setAdrDkey("     ");
                //////////////////////////////////////////////////////////////////////////////////////////////
                logger.debug("MOVE 'RCI01' TO ADR-DKEY IN ADR-REQA");

                adrReqa.setAdrDkey("RCI01");

                logger.debug("adrReqa.getAdrDkey() :" + adrReqa.getAdrDkey());
            }
            else {

                //// setters /////////////////////////////////////////////////////////////////////////////////
                //fioCtts.getFioMens().setValue("                                                                                ");
                //////////////////////////////////////////////////////////////////////////////////////////////
                logger.debug("MOVE 'En GNS-FIO-RCI, key' TO FIO-MENS");

                fioCtts.getFioMens().setValue("En GNS-FIO-RCI, key");

                logger.debug("fioCtts.getFioMens().getValue() :" + fioCtts.getFioMens().getValue());

                //// setters /////////////////////////////////////////////////////////////////////////////////
                //fioCtts.getFioMensRed().setFioMensKey("                                ");
                //fioVari.setFioAkey("                                ");
                //////////////////////////////////////////////////////////////////////////////////////////////
                logger.debug("MOVE FIO-AKEY TO FIO-MENS-KEY");

                fioCtts.getFioMensRed().setFioMensKey(fioVari.getFioAkey());

                logger.debug("fioCtts.getFioMensRed().getFioMensKey() :" + fioCtts.getFioMensRed().getFioMensKey());
                logger.debug("fioVari.getFioAkey() :" + fioVari.getFioAkey());

                //// setters /////////////////////////////////////////////////////////////////////////////////
                //fioCtts.getFioMensRed().setFioMensFil("         ");
                //////////////////////////////////////////////////////////////////////////////////////////////
                logger.debug("MOVE 'Invalida' TO FIO-MENS-FIL");

                fioCtts.getFioMensRed().setFioMensFil("Invalida");

                logger.debug("fioCtts.getFioMensRed().getFioMensFil() :" + fioCtts.getFioMensRed().getFioMensFil());

                execute("prgAbt");
            }
        }

        logger.debug("saliendo de 'gnsFioRci_fsrGnsFioRci()' ...");

        return "gnsFioRci_conGnsFioRci";
    }

